import React from 'react';
import './card_content_review.css';
import {
  Card, CardImg, CardText, CardBody,CardFooter,
  CardTitle, CardSubtitle, Button,CardDeck
} from 'reactstrap';
import CardReview from './card_review_json'

class CardReviews extends React.Component{
  render(){
    return(
      <div className="cardreviews">
      <h1>Costumers Review</h1>
      <CardDeck>
      {CardReview.map((item)=>{
        return(
          <div>
          <Card>
              <CardBody>
                <CardTitle tag="h4">llll</CardTitle>
                <CardSubtitle  tag="span" className="mb-2">jjj</CardSubtitle>
                <CardText>kkkk</CardText>
              </CardBody>
                <CardText>
                  <small className="text-muted">Last updated 3 mins ago</small>
                </CardText>
          </Card>
          </div>
        )})}
      </CardDeck>
    </div>
    )
  }
}

export default CardReviews
